// TODO Try to add bootstrap

import React from "react";
import Navbar from 'react-bootstrap/Navbar'
import Container from 'react-bootstrap/Container'
import Nav from 'react-bootstrap/Nav'
import NavDropdown from 'react-bootstrap/NavDropdown'

const MyNavbar = () => {

    let logged = true
    let name = "Bob"

    let arr = [1,2,3]

    return(
        <Navbar bg="primary" variant="dark"  expand="lg" className="justify-content-between">
            <Navbar.Brand href="#home" className="mr-1">BlueberryPi</Navbar.Brand>
            <Navbar.Toggle aria-controls="basic-navbar-nav" />
            <Navbar.Collapse id="basic-navbar-nav">
              <Nav className="me-auto d-flex flex-grow-1">
                {!logged && <Nav.Link href="#login">Login</Nav.Link>}
                <NavDropdown title="Locations" id="basic-nav-dropdown" className="flex-grow-1">
                  {
                    arr.map(
                      (elem) => { return ( <NavDropdown.Item href={"#location"+elem}>Location {elem}</NavDropdown.Item>) }
                    )
                  }
                </NavDropdown>
                {logged && <Navbar.Text className="ml-auto" >Hello {name}!</Navbar.Text>}
              </Nav>
            </Navbar.Collapse>
        </Navbar>
    )

}

export default MyNavbar;
